import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="gallery-container">
      <h1 className="welcome-message">Welcome to TravelMate!</h1>
      <div className="image-gallery">
        <img src="/images/image1.jpg" alt="Travel Destination 1" />
        <img src="/images/image2.jpg" alt="Travel Destination 2" />
        <img src="/images/image3.jpg" alt="Travel Destination 3" />
        <img src="/images/image4.jpg" alt="Travel Destination 4" />
        <img src="/images/image5.jpg" alt="Travel Destination 5" />
        <img src="/images/image6.jpg" alt="Travel Destination 6" />
        <img src="/images/image7.jpg" alt="Travel Destination 7" />
        <img src="/images/image8.jpg" alt="Travel Destination 8" />
        <img src="/images/image9.jpg" alt="Travel Destination 9" />
        <img src="/images/image10.jpg" alt="Travel Destination 10" />
        <img src="/images/image11.jpg" alt="Travel Destination 11" />
        <img src="/images/image12.jpg" alt="Travel Destination 12" />
        <img src="/images/image13.jpg" alt="Travel Destination 13" />
        <img src="/images/image14.jpg" alt="Travel Destination 14" />
        <img src="/images/image15.jpg" alt="Travel Destination 15" />
        <img src="/images/image16.jpg" alt="Travel Destination 16" />
        <img src="/images/image17.jpg" alt="Travel Destination 17" />
        <img src="/images/image18.jpg" alt="Travel Destination 18" />
        {/* Add more images as desired */}
      </div>
    </div>
  );
};

export default HomePage;
